INSERT INTO `author` VALUES (1,'Orson Scott Card','<p>Orson Scott Card is the bestselling author best known for the classic Ender\'s Game, Ender\'s Shadow and other novels in the Ender universe. Most recently, he was awarded the 2008 Margaret A. Edwards Award for lifetime achievement in Young Adult literature, from the American Library Association. Card has written sixty-one books, assorted plays, comics, and essays and newspaper columns. His work has won multiple awards, including back-to-back wins of the Hugo and the Nebula Awards-the only author to have done so in consecutive years. His titles have also landed on \'best of\' lists and been adopted by cities, universities and libraries for reading programs. The Ender novels have inspired a Marvel Comics series, a forthcoming video game from Chair Entertainment, and pre-production on a film version. A highly anticipated The Authorized Ender Companion, written by Jake Black, is also forthcoming.Card offers writing workshops from time to time and occasionally teaches writing and literature at universities. Orson Scott Card currently lives with his family in Greensboro, NC.<p>'),(2,'George Orwell','<p>His work is marked by lucid prose, awareness of social injustice, opposition to totalitarianism, and outspoken support of democratic socialism.</p>\r\n<p>Orwell wrote literary criticism, poetry, fiction, and polemical journalism. He is perhaps best known for his dystopian novel Nineteen Eighty-Four (1949) and the allegorical novella Animal Farm (1945). His non-fiction works, including The Road to Wigan Pier (1937), documenting his experience of working class life in the north of England, and Homage to Catalonia (1938), an account of his experiences in the Spanish Civil War, are widely acclaimed, as are his essays on politics, literature, language, and culture. In 2008, The Times ranked him second on a list of \"The 50 greatest British writers since 1945\".</p>\r\n<p>Orwell\'s work continues to influence popular and political culture, and the term Orwellian-descriptive of totalitarian or authoritarian social practices-has entered the language together with many of his neologisms, including cold war, Big Brother, thought police, Room 101, memory hole, newspeak, doublethink, and thoughtcrime.</p>'),(3,'Ray Bradbury','<p>In a career spanning more than seventy years, Ray Bradbury, who died on June 5, 2012, at the age of 91, inspired generations of readers to dream, think, and create. A prolific author of hundreds of short stories and close to fifty books, as well as numerous poems, essays, operas, plays, teleplays, and screenplays, Bradbury was one of the most celebrated writers of our time. His groundbreaking works include Fahrenheit 451, The Martian Chronicles, The Illustrated Man, Dandelion Wine, and Something Wicked This Way Comes. He wrote the screen play for John Huston\'s classic film adaptation of Moby Dick, and was nominated for an Academy Award. He adapted sixty-five of his stories for television\'s The Ray Bradbury Theater, and won an Emmy for his teleplay of The Halloween Tree. He was the recipient of the 2000 National Book Foundation Medal for Distinguished Contribution to American Letters, the 2004 National Medal of Arts, and the 2007 Pulitzer Prize Special Citation, among many honors.</p>\n<p>Throughout his life, Bradbury liked to recount the story of meeting a carnival magician, Mr. Electrico, in 1932. At the end of his performance Electrico reached out to the twelve-year-old Bradbury, touched the boy with his sword, and commanded, \"Live forever!\" Bradbury later said, \"I decided that was the greatest idea I had ever heard. I started writing every day. I never stopped.\"</p>'),(4,'Stephen King','<p>Stephen King is the author of more than fifty books, all of them worldwide bestsellers. His recent work includes Doctor Sleep and Under the Dome, now a major TV miniseries on CBS. His novel 11/22/63 was named a top ten book of 2011 by The New York Times Book Review and won the Los Angeles Times Book Prize for Mystery/Thriller as well as the Best Hardcover Book Award from the International Thriller Writers Association. He is the recipient of the 2003 National Book Foundation Medal for Distinguished Contribution to American Letters. He lives in Bangor, Maine, with his wife, novelist Tabitha King.</p>'),(5,'J.K. Rowling','<p>J.K. Rowling is the author of the seven Harry Potter novels, which have sold over 450 million copies and have been translated into 79 languages, and three companion books originally published for charity. She is also the author of The Casual Vacancy, a novel for adults published in 2012, and, under the pseudonym of Robert Galbraith, is the author of the Cormoran Strike crime series. J.K. Rowling is making her screenwriting debut and is a producer on the film Fantastic Beasts and Where to Find Them, a further extension of the Wizarding World, due for release in November 2016.</p>\r\n<p>Jack Thorne writes for theatre, film, television and radio. His theatre credits include Hope and Let The Right One In, both directed by John Tiffany, The Solid Life of Sugarwater for the Graeae Theatre Company, Bunny for the Edinburgh Fringe Festival, Stacy for the Trafalgar Studios, 2nd May 1997 and When You Cure Me for the Bush. His adaptations include The Physicists for the Donmar Warehouse and Stuart: A Life Backwards for Hightide. On film his credits include War Book, A Long Way Down and The Scouting Book for Boys. For television his credits include The Last Panthers, Don\'t Take My Baby, This Is England, The Fades, Glue and Cast-Offs and the upcoming National Treasure. In 2012 he won BAFTAs for best series (The Fades) and best serial (This Is England 88).</p>\r\n<p>John Tiffany directed Once for which he was the recipient of multiple awards both in the West End and on Broadway. As Associate Director of the Royal Court, his work includes The Twits, Hope and The Pass. He was the director of Let The Right One In for the National Theatre of Scotland, which transferred to the Royal Court, West End and St. Anna\'s Warehouse. His other work for the National Theatre of Scotland includes Macbeth (also Broadway), Enquirer, The Missing, Peter Pan, The House of Bernarda Alba, Transform Caithness: Hunter, Be Near Me, Nobody Will Ever Forgive Us, The Bacchae, Black Watch, for which he won the Olivier and Criticsâ„¢ Circle Best Director Awards, Elizabeth Gordon Quinn and Home: Glasgow. Other recent credits include The Glass Menagerie at A.R.T. and on Broadway and The Ambassador at BAM. Tiffany was Associate Director of the National Theatre of Scotland from 2005 to 2012, and was a Radcliffe Fellow at Harvard University in the 2010-2011 academic year.</p>'),(6,'Laura Esquivel','<p>Laura Esquivel (born September 30, 1950) is a Mexican novelist, essayist, and screenwriter who has made noted contributions to Latin-American literature. Her first novel Como agua para chocolate (Like Water for Chocolate) became a bestseller in Mexico and the United States, and was later developed into an award-winning film.</p>\r\n<p>She was born the third of four children to Julio Cesar Esquivel, a telegraph operator, and Josefa Valdes.</p>\r\n<p>Esquivel was once married to actor and director Alfonso Arau. She currently lives in Mexico City.</p>\r\n<p>In March 2009 Laura Esquivel ran as preliminary candidate of the Local Council in District XXVII of Mexico City for the PRD. Her candidacy was supported by the current Izquierda Unida, which combined various PRD groups. Despite irregularities, all ballots were recovered, confirming her victory.</p>'),(7,'William Golding','<p>Sir William Gerald Golding CBE (19 September 1911 - 19 June 1993) was a British novelist, playwright, and poet. Best known for his novel Lord of the Flies, he won a Nobel Prize in Literature, and was also awarded the Booker Prize for literature in 1980 for his novel Rites of Passage, the first book in what became his sea trilogy, To the Ends of the Earth.</p>\r\n<p>Golding was knighted by Elizabeth II in 1988. He was a fellow of the Royal Society of Literature. In 2008, The Times ranked Golding third on their list of \"The 50 greatest British writers since 1945\".</p>'),(8,'Mitchell Zuckoff','<p>Mitchell Zuckoff is the Sumner M. Redstone Professor of Narrative Studies at Boston University and a No. 1 New York Times bestselling author. Previously, he was a reporter and writing coach for The Boston Globe, where he was a finalist for a Pulitzer Prize in investigative reporting. His honors include the PEN/Winship Award for Nonfiction, the Distinguished Writing Award from the American Society of Newspaper Editors, The Livingston Award for International Reporting, and The Heywood Broun Award, among others. He received a master\'s degree from the University of Missouri and was a Batten Fellow at the University of Virginia. He lives outside Boston. His website is www.mitchellzuckoff.com.</p>'),(9,'Elie Wiesel','<p>Born September 30, 1928, Elie Wiesel is an American Romanian-born Jewish writer, professor, political activist, Holocaust survivor, and Nobel Laureate. He is the author of 57 books, written mostly in French and English, including Night, a work based on his experiences as a prisoner in the Auschwitz, Buna, and Buchenwald concentration camps. Wiesel is also the Advisory Board chairman of the newspaper Algemeiner Journal. He is currently the Andrew Mellon Professor of the Humanities at Boston University, in Boston, Massachusetts.</p>'),(10,'John Steinbeck','<p>John Ernst Steinbeck, Jr. (February 27, 1902 - December 20, 1968) was an American author of twenty-seven books, including sixteen novels, six non-fiction books, and five collections of short stories. He is widely known for the comic novels Tortilla Flat (1935) and Cannery Row (1945), the multi-generation epic East of Eden (1952), and the novellas Of Mice and Men (1937) and The Red Pony (1937). The Pulitzer Prize-winning The Grapes of Wrath (1939), widely attributed to be part of the American literary canon, is considered Steinbeck\'s masterpiece. In the first 75 years since it was published, it sold 14 million copies.</p>\r\n<p>The winner of the 1962 Nobel Prize in Literature, he has been called \"a giant of American letters\". His works are widely read abroad and many of his works are considered classics of Western literature.</p>\r\n<p>Most of Steinbeck\'s work is set in southern and central California, particularly in the Salinas Valley and the California Coast Ranges region. His works frequently explored the themes of fate and injustice, especially as applied to downtrodden or everyman protagonists.</p>'),(11,'Lois Lowry','<p>Lois Lowry (born Lois Ann Hammersberg; March 20, 1937) is an American writer credited with more than thirty children\'s books. She has won two Newbery Medals, for Number the Stars in 1990 and The Giver in 1994. For her contribution as a children\'s writer, she was a finalist in 2000 (and U.S. nominee again in 2004, as well as a finalist in 2016) for the biennial, international Hans Christian Andersen Award, the highest recognition available to creators of children\'s books. Her book Gooney Bird Greene won the 2002 Rhode Island Children\'s Book Award. In 2007 she received the Margaret Edwards Award from the American Library Association for her contribution in writing for teens. In 2011 she gave the May Hill Arbuthnot Lecture; her lecture was titled \"UNLEAVING: The Staying Power of Gold\". She was also awarded an honorary Doctorate of Letters by Brown University in 2014.</p>\r\n<p>As an author, Lowry is known for writing about difficult subject matters within her works for children. She has explored such complex issues as racism, terminal illness, murder, and the Holocaust among other challenging topics. She has also explored very controversial issues of questioning authority such as in The Giver quartet. Her writing on such matters has brought her both praise and criticism. In particular, her work The Giver, the first novel in The Giver quartet, has been met with a diversity of reactions from schools in America, some of which have adopted it as a part of the mandatory curriculum, while others have prohibited the book\'s inclusion in classroom studies. The Giver has also been made into a film, also called The Giver, which was released in 2014.</p>'),(12,'Harper Lee','<p>Nelle Harper Lee (April 28, 1926 - February 19, 2016), better known by her pen name Harper Lee, was an American novelist widely known for To Kill a Mockingbird, published in 1960. Immediately successful, it won the 1961 Pulitzer Prize and has become a classic of modern American literature. Though Lee had only published this single book, in 2007 she was awarded the Presidential Medal of Freedom for her contribution to literature. Additionally, Lee received numerous honorary degrees, though she declined to speak on those occasions. She was also known for assisting her close friend Truman Capote in his research for the book In Cold Blood (1966). Capote was the basis for the character Dill in To Kill a Mockingbird.</p>\r\n<p>The plot and characters of To Kill a Mockingbird are loosely based on Lee\'s observations of her family and neighbors, as well as an event that occurred near her hometown in 1936, when she was 10 years old. The novel deals with the irrationality of adult attitudes towards race and class in the Deep South of the 1930s, as depicted through the eyes of two children. The novel was inspired by racist attitudes in her hometown of Monroeville, Alabama.</p>');
