INSERT INTO `book` VALUES ('9780061988356','0061988359','Lost in Shangri-La','History',8,10.66,'<p>\"A lost world, man-eating tribesmen, lush and impenetrable jungles, stranded American fliers (one of them a dame with great gam, for heaven\'s sake), a startling rescue mission. . . . This is a true story made in heaven for a writer as talented as Mitchell Zuckoff. Whew, what an utterly compelling and deeply satisfying read!\" - Simon Winchester, author of Atlantic</p>\r\n<p>Award-winning former Boston Globe reporter Mitchell Zuckoff unleashes the exhilarating, untold story of an extraordinary World War II rescue mission, where a plane crash in the South Pacific plunged a trio of U.S.military personnel into a land that time forgot. Fans of Hampton Sides\' Ghost Soldiers, Marcus Luttrell\'s Lone Survivor, and David Grann\'s The Lost City of Z will be captivated by Zuckoff\'s masterfully recounted, all-true story of danger, daring, determination, and discovery in jungle-clad New Guinea during the final days of WWII.</p>','img/lostinshangrila.jpg'),('9780140177398','0140177396','Of Mice and Men','Contemporary',10,6.99,'<p>They are an unlikely pair: George is \"small and quick and dark of face\"; Lennie, a man of tremendous size, has the mind of a young child. Yet they have formed a \"family,\" clinging together in the face of loneliness and alienation.</p>\r\n<p>They are an unlikely pair: George is \"small and quick and dark of face\"; Lennie, a man of tremendous size, has the mind of a young child. Yet they have formed a \"family,\" clinging together in the face of loneliness and alienation.</p>\r\n<p>\"A thriller, a gripping tale . . . that you will not set down until it is finished. Steinbeck has touched the quick.\" -The New York Times</p>','img/ofmiceandmen.jpg'),('9780374500016','0374500010','Night','Memoir',9,7.50,'<p>Night is Elie Wiesel\'s masterpiece, a candid, horrific, and deeply poignant autobiographical account of his survival as a teenager in the Nazi death camps. This new translation by Marion Wiesel, Elie\'s wife and frequent translator, presents this seminal memoir in the language and spirit truest to the author\'s original intent. And in a substantive new preface, Elie reflects on the enduring importance of Night and his lifelong, passionate dedication to ensuring that the world never forgets man\'s capacity for inhumanity to man.</p>\r\n<p>Night offers much more than a litany of the daily terrors, everyday perversions, and rampant sadism at Auschwitz and Buchenwald; it also eloquently addresses many of the philosophical as well as personal questions implicit in any serious consideration of what the Holocaust was, what it meant, and what its legacy is and will be.</p>','img/night.jpg'),('9780385420174','0385420174','Like Water for Chocolate','Contemporary',6,8.92,'<p>Like Water for Chocolate (Spanish: Como agua para chocolate) is a popular novel published in 1989 by first-time Mexican novelist Laura Esquivel.</p>\r\n<p>The novel follows the story of a young girl named Tita who longs her entire life to marry her lover, Pedro, but can never have him because of her mother\'s upholding of the family tradition of the youngest daughter not marrying but taking care of her mother until the day she dies. Tita is only able to express herself when she cooks.</p>\r\n<p>Esquivel employs magical realism to combine the supernatural with the ordinary.</p>','img/likewaterforchocolate.jpg'),('9780399501487','0399501487','Lord of the Flies','Allegorical',7,8.49,'<p>Lord of the Flies remains as provocative today as when it was first published in 1954, igniting passionate debate with its startling, brutal portrait of human nature. Though critically acclaimed, it was largely ignored upon its initial publication. Yet soon it became a cult favorite among both students and literary critics who compared it to J.D. Salinger\'s The Catcher in the Rye in its influence on modern thought and literature.</p>\r\n<p>William Golding\'s compelling story about a group of very ordinary small boys marooned on a coral island has become a modern classic. At first it seems as though it is all going to be great fun; but the fun before long becomes furious and life on the island turns into a nightmare of panic and death. As ordinary standards of behaviour collapse, the whole world the boys know collapses with them-the world of cricket and homework and adventure stories-and another world is revealed beneath, primitive and terrible. Labeled a parable, an allegory, a myth, a morality tale, a parody, a political treatise, even a vision of the apocalypse, Lord of the Flies has established itself as a true classic.</p>','img/lordoftheflies.jpg'),('9780446310789','0446310786','To Kill a Mockingbird','Classic',12,5.89,'<p>The unforgettable novel of a childhood in a sleepy Southern town and the crisis of conscience that rocked it, To Kill A Mockingbird became both an instant bestseller and a critical success when it was first published in 1960. It went on to win the Pulitzer Prize in 1961 and was later made into an Academy Award-winning film, also a classic.</p>\r\n<p>Compassionate, dramatic, and deeply moving, To Kill A Mockingbird takes readers to the roots of human behavior - to innocence and experience, kindness and cruelty, love and hatred, humor and pathos. Now with over 18 million copies in print and translated into forty languages, this regional story by a young Alabama woman claims universal appeal. Harper Lee always considered her book to be a simple love story. Today it is regarded as a masterpiece of American literature.</p>','img/tokillamockingbird.jpg'),('9780544336261','0544336267','The Giver','Dystopian',11,4.39,'<p>The Giver is a 1993 American young-adult dystopian novel by Lois Lowry. It is set in a society which at first appears to be a utopian society but is revealed to be a dystopian one as the story progresses. The novel follows a boy named Jonas through the 12th and 13th years of his life. The society has eliminated pain and strife by converting to \"Sameness,\" a plan that has also eradicated emotional depth from their lives. Jonas is selected to inherit the position of Receiver of Memory, the person who stores all the past memories of the time before Sameness, as there may be times where one must draw upon the wisdom gained from history to aid the community\'s decision making. Jonas struggles with concepts of all the new emotions and things introduced to him: whether they are inherently good, evil, or in between, and whether it is even possible to have one without the other. The Community lacks any color, memory, climate and terrain, all in effort to preserve structure, order, and a true sense of equality beyond personal individuality.</p>\r\n<p>The Giver won the 1994 Newbery Medal and sold more than 10 million copies worldwide to 2014. In Australia, Canada, and the United States, it is on many middle school reading lists, but it is also frequently challenged and it ranked number 11 on the American Library Association list of the most challenged books of the 1990s. A 2012 survey based in the U.S. designated it the fourth-best children\'s novel of all time.</p>','img/thegiver.jpg'),('9780812550702','0812550706','Ender\'s Game','Science Fiction',1,5.99,'<p>In order to develop a secure defense against a hostile alien race\'s next attack, government agencies breed child geniuses and train them as soldiers. A brilliant young boy, Andrew \"Ender\" Wiggin lives with his kind but distant parents, his sadistic brother Peter, and the person he loves more than anyone else, his sister Valentine. Peter and Valentine were candidates for the soldier-training program but didn\'t make the cut--young Ender is the Wiggin drafted to the orbiting Battle School for rigorous military training.</p>\r\n<p>Ender\'s skills make him a leader in school and respected in the Battle Room, where children play at mock battles in zero gravity. Yet growing up in an artificial community of young soldiers, Ender suffers greatly from isolation, rivalry from his peers, pressure from the adult teachers, and an unsettling fear of the alien invaders. His psychological battles include loneliness, fear that he is becoming like the cruel brother he remembers, and fanning the flames of devotion to his beloved sister.</p>\r\n<p>Is Ender the general Earth needs? But Ender is not the only result of the genetic experiments. The war with the Buggers has been raging for a hundred years, and the quest for the perfect general has been underway for almost as long. Ender\'s two older siblings are every bit as unusual as he is, but in very different ways. Between the three of them lie the abilities to remake a world. If the world survives, that is.</p>\r\n<p>Winner of the Hugo and Nebula Awards.</p>','img/endersgame.jpg'),('9781338099133','1338099132','Harry Potter and the Cursed Child - Parts I & II','Fantasy',5,17.99,'<p>Based on an original new story by J.K. Rowling, Jack Thorne and John Tiffany, a new play by Jack Thorne, Harry Potter and the Cursed Child is the eighth story in the Harry Potter series and the first official Harry Potter story to be presented on stage. The play will receive its world premiere in London\'s West End on July 30, 2016.</p>\r\n<p>It was always difficult being Harry Potter and it isn\'t much easier now that he is an overworked employee of the Ministry of Magic, a husband and father of three school-age children.</p>\r\n<p>While Harry grapples with a past that refuses to stay where it belongs, his youngest son Albus must struggle with the weight of a family legacy he never wanted. As past and present fuse ominously, both father and son learn the uncomfortable truth: sometimes, darkness comes from unexpected places.</p>','img/harrypotterandthecursedchild.jpg'),('9781451673319','1451673310','Fahrenheit 451','Science Fiction',3,9.52,'<p>Ray Bradbury\'s internationally acclaimed novel Fahrenheit 451 is a masterwork of twentieth-century literature set in a bleak, dystopian future.</p>\r\n<p>Guy Montag is a fireman. In his world, where television rules and literature is on the brink of extinction, firemen start fires rather than put them out. His job is to destroy the most illegal of commodities, the printed book, along with the houses in which they are hidden.</p>\r\n<p>Montag never questions the destruction and ruin his actions produce, returning each day to his bland life and wife, Mildred, who spends all day with her television \"family.\" But then he meets an eccentric young neighbor, Clarisse, who introduces him to a past where people didn\'t live in fear and to a present where one sees the world through the ideas in books instead of the mindless chatter of television.</p>\r\n<p>When Mildred attempts suicide and Clarisse suddenly disappears, Montag begins to question everything he has ever known. He starts hiding books in his home, and when his pilfering is discovered, the fireman has to run for his life.</p>','img/fahrenheit451.jpg'),('9781501143519','1501143514','The Dark Tower: The Gunslinger','Fantasy',4,14.30,'<p>\"An impressive work of mythic magnitude that may turn out to be Stephen King\'s greatest literary achievement\"(The Atlanta Journal-Constitution), The Gunslinger is the first volume in the epic Dark Tower Series.</p>\r\n<p>A #1 national bestseller, The Gunslinger introduces readers to one of Stephen King\'s most powerful creations, Roland of Gilead: The Last Gunslinger. He is a haunting figure, a loner on a spellbinding journey into good and evil. In his desolate world, which mirrors our own in frightening ways, Roland tracks The Man in Black, encounters an enticing woman named Alice, and begins a friendship with the boy from New York named Jake.</p>\r\n<p>Inspired in part by the Robert Browning narrative poem, \"Childe Roland to the Dark Tower Came,\"The Gunslinger is \"a compelling whirlpool of a story that draws one irretrievable to its center\" (Milwaukee Sentinel). It is \"brilliant and fresh and will leave you panting for more\" (Booklist).</p>','img/gunslinger.jpg'),('9788499890944','8499890946','1984','Science Fiction',2,10.00,'<p>Nineteen Eighty-Four, often published as 1984, is a dystopian novel by English author George Orwell published in 1949. The novel is set in Airstrip One (formerly known as Great Britain), a province of the superstate Oceania in a world of perpetual war, omnipresent government surveillance and public manipulation, dictated by a political system euphemistically named English Socialism (or Ingsoc in the government\'s invented language, Newspeak) under the control of a privileged elite of the Inner Party, that persecutes individualism and independent thinking as \"thoughtcrime.\"</p>','img/1984.jpg');
